import React from 'react';
import { myPalette } from './appearance/paletteConstants.js';


export const Header = () => {

    const headerStyle = {

        width: '100%',
        padding: '2%',
        backgroundColor: myPalette.colour1,
        color: myPalette.colour2,
        textAlign: 'center'
    }

    return(
        <div style={headerStyle}>
            <h1>React CYOA</h1>
        </div>
    )
}
